const formSubmitHandler = async (event) => {
  event.preventDefault();
  let credentials = {
    email: email,
    password: password,
  };

  credentials = JSON.stringify(credentials);

  console.log("CREDENTIALS: ", credentials);

  setIsLoading(true);

  let loginData = await FETCH(credentials, "/api/get_credentials");

  console.log("LOGIN DATA: ", loginData);

  if (loginData.idToken) {
    console.log("LOGIN DATA SUCCESS");

    const data = await SIGN_LOG_IN_FETCH(loginData, "/api/login");

    console.log("USER DATA: ", data);

    const mealData = {
      fullMenu: data.fullMenu,
      ingredients: data.ingredients,
      weeklyList: data.weeklyList,
    };
    const token = data.token;
    const userName = data.displayName;
    const profile = { ...data.profile, userId: data._id };
    const expirationTime = new Date(
      new Date().getTime() + +data.expiresIn * 1000
    );
    authCtx.login(token, userName, expirationTime, profile, mealData);
  } else {
    console.log(
      "LOGIN DATA DOES NOT CONTAIN THE NECESSARY INFORMATION: ",
      loginData
    );
  }
  setIsLoading(false);
};


